import TaskList from './components/TaskList';

function App() {
  return (
    <div className="App">
      <TaskList />
      <ul>
            <li>Employee 1</li>
            <li>Employee 2</li>
            <li>Employee 3</li>
        </ul>
    </div>
  );
}

export default App;
